// IMPORT ASSETS
import "./styles.scss";
import Artist from './Artist';
import Music from './Music';
import Playlist from './Playlist';

const Results = () => { 

  const src = 'https://static-s.aa-cdn.net/img/gp/20600013534348/bzFurMYENUE4GFit07FJ0F0Ln1fplfW8yvGz4i5PoQfEDFn3q1DT0_qqKw9YBohDPg=s300?v=1';

  return(

    <div className="results"> 
      <h1 className="results__h1"> Search Result Text</h1>
      <Music src={src} />
      <Artist src={src} />
      <Playlist src={src} />
    </div>

  );
};

export default Results;
